import { Box, Flex, Spacer , Button, Heading} from "@chakra-ui/react";
import React from "react";
import { Link } from "react-router-dom";


import { FaSignInAlt, FaHome } from "react-icons/fa"
import { ColorModeSwitcher } from '../ColorModeSwitcher';

import { SiGnuprivacyguard } from "react-icons/si"
const Navbar = () => {
  return (
    <>
      <Flex p={2} 
        mt={1}
        mb={15}
        color='red'
        boxShadow='teal-lg' 
        rounded='md' 
        backdropFilter='auto' backdropBlur='6px'
      >

        <Box p={2}>
          <Heading size="md">Apartment</Heading>
        </Box>
        <Spacer />
        <Box>
            <ColorModeSwitcher />
            <Link to='/'>
                <Button rightIcon={<FaHome />} colorScheme="red" mr="4" size='md' variant='solid'
                >
                    Home
                </Button>
            </Link>
            <Link to='/signin'>
                <Button rightIcon={<SiGnuprivacyguard />} colorScheme="red" size='md' mr="4" variant='solid'>
                    Sign Up
                </Button>
            </Link>
            <Link to='/login'>
                <Button rightIcon={<FaSignInAlt />} colorScheme="red" mr="4" size='md' variant='solid'>Log in</Button>
            </Link>
        </Box>
      </Flex>
    </>
  );
};

export default Navbar;
